$(document).ready(function(){

	$('.container-slides').slick({
		arrows: false,
		dots: true
	});

	$('.sabores .carousel-sabores').slick({
		dots: true
	});

	$('.carousel-depoimentos').slick();

	$('.sabores-interna .carousel-sabores').slick({
		dots: true,
		slidesToShow: 4,
		slidesToScroll: 1,
		arrows: false,
		responsive: [
			{
				breakpoint: 991,
				settings: {
					slidesToShow: 1,
        			slidesToScroll: 1
				}
			}
		]
	});

	$(document).foundation();

	if($(window).width() > 1025) {
		var s = skrollr.init({forceHeight: false});
	} else {
		
	}

	$('header.inicial').css('height',$(window).height());

	$('header .texto-esquerdo').addClass('animated fadeInUp');
	$('header .sorvete').addClass('animated fadeInUp');
	$('header .texto-direito').addClass('animated fadeInDown');

	$('header .texto-esquerdo').css('opacity','1');
	$('header .sorvete').css('opacity','1');
	$('header .texto-direito').css('opacity','1');



	
	$('main .noticias .noticia .ver-noticia').on('mouseover', function() {
		$(this).parent().find('.after-img').css('background','#eb135a');
		$(this).parent().find('.ver-noticia').css('background','url(../assets/img/seta-rosa.png) no-repeat');
	});

	$('main .noticias .noticia .ver-noticia').on('mouseout', function() {
		$(this).parent().find('.after-img').css('background','#fbdea7');
		$(this).parent().find('.ver-noticia').css('background','url(../assets/img/seta-amarela.png) no-repeat');
	});

	$('main .noticias .imagem a').on('mouseover', function() {
		$(this).parent().parent().find('.after-img').css('background','#eb135a');
		$(this).parent().parent().find('.ver-noticia').css('background','url(../assets/img/seta-rosa.png) no-repeat');
	});

	$('main .noticias .imagem a').on('mouseout', function() {
		$(this).parent().parent().find('.after-img').css('background','#fbdea7');
		$(this).parent().parent().find('.ver-noticia').css('background','url(../assets/img/seta-amarela.png) no-repeat');
	});

	$('main .noticias .noticia h2 a').on('mouseover', function() {
		$(this).parent().parent().find('.after-img').css('background','#eb135a');
		$(this).parent().parent().find('.ver-noticia').css('background','url(../assets/img/seta-rosa.png) no-repeat');
	});

	$('main .noticias .noticia h2 a').on('mouseout', function() {
		$(this).parent().parent().find('.after-img').css('background','#fbdea7');
		$(this).parent().parent().find('.ver-noticia').css('background','url(../assets/img/seta-amarela.png) no-repeat');
	});

	$('.ir-topo').on('click', function() {
		$('html, body').animate({ scrollTop: 0 }, 800);
	});

	$('#slide-down').on('click', function(){
		$('html, body').animate({ scrollTop: 370 }, 800);
	});

	$('#voltar-stack').on('click', function(){
		var fc = $('main .carousel-valores .item:first-child').clone();
			$('main .carousel-valores .item:first-child').animate({
	            'transform':'translate3d(-300px,0,0)'
	        }, function(){
	            $('main .carousel-valores .item:first-child').remove();
	            $('main .carousel-valores').append(fc);
	        });
	});


	$('#avancar-stack').on('click', function(){
		var lc = $('main .carousel-valores .item:last-child').clone();
		$('main .carousel-valores .item:last-child').animate({
	          	'transform':'translate3d(879px,0,0)'
	      	}, function(){
	          	$('main .carousel-valores .item:last-child').remove();
	          	$('main .carousel-valores').prepend(lc);
	      	});
	});

	$('#voltar-stack-f').on('click', function(){
		var fc = $('main .carousel-franqueados .item:first-child').clone();
			$('main .carousel-franqueados .item:first-child').animate({
	            'transform':'translate3d(-300px,0,0)'
	        }, function(){
	            $('main .carousel-franqueados .item:first-child').remove();
	            $('main .carousel-franqueados').append(fc);
	        });
	});

	$('#avancar-stack-f').on('click', function(){
		var lc = $('main .carousel-franqueados .item:last-child').clone();
		$('main .carousel-franqueados .item:last-child').animate({
	          	'transform':'translate3d(879px,0,0)'
	      	}, function(){
	          	$('main .carousel-franqueados .item:last-child').remove();
	          	$('main .carousel-franqueados').prepend(lc);
	      	});
	});

	$('#fechar-legenda').on('click', function(){
		$(this).parent().hide();
	});

	$(document).on('scroll', function(){
		
		if(document.body.scrollTop >= $('header.inicial').height()) {
			$('main .seja-franqueado').css('position','fixed');
		} else {
			$('main .seja-franqueado').css('position','relative');
		}
	});

	

	$('body').mousemove(function(e){

		var t = $(this), 
			n = t.height() / 2, 
			r = t.width() / 2, 
			i = e.clientX - t.offset().left, 
			s = e.clientY - t.offset().top, 
			o = (r - i) / t.width(), 
			u = (n - s) / t.height(), 
			a = o * (t.width() / 18), 
			f = u * (t.height() / 18);
		TweenMax.to(t.find("header .texto-esquerdo"), 3, {x: a, y: f, z: 0, overwrite: 1});

		var t = $(this), 
			n = t.height() / 100, 
			r = t.width() / 100, 
			i = e.clientX - t.offset().left, 
			s = e.clientY - t.offset().top, 
			o = (r - i) / t.width(), 
			u = (n - s) / t.height(), 
			a = o * (t.width() / 25), 
			f = u * (t.height() / 25);
		TweenMax.to(t.find("header .sorvete"), 1, {x: a, y: f, z: 2, overwrite: 1});

		var t = $(this), 
			n = t.height() / 3, 
			r = t.width() / 3, 
			i = e.clientX - t.offset().left, 
			s = e.clientY - t.offset().top, 
			o = (r - i) / t.width(), 
			u = (n - s) / t.height(), 
			a = o * (t.width() / 25), 
			f = u * (t.height() / 25);
		TweenMax.to(t.find("header .texto-direito"), 2, {x: a, y: f, z: 0, overwrite: 1});
	});

	


});
